export class FrostedGlassContainer {
    constructor() {
        this.stretch = false;
    }
    render() {
        return (h("div", { class: this.stretch ? `stretch` : '' },
            h("slot", null)));
    }
    static get is() { return "frosted-glass-container"; }
    static get properties() { return { "stretch": { "type": Boolean, "attr": "stretch" } }; }
    static get style() { return "/**style-placeholder:frosted-glass-container:**/"; }
}
